import React, { useEffect } from 'react'
import { UserProvider, useUsers } from '../../Context/UsuariosContexto'


function VerUsuarios() {

    const {getUsuarios, usuarios} = useUsers()

    useEffect(()=>{
        getUsuarios()
          // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])

  return (
      <UserProvider>
<div>VerUsuarios</div>
</UserProvider>
  )
}

export default VerUsuarios
